'use strict';

/**
* A list of common female first names in English speaking countries.
*
* @module @stdlib/datasets/female-first-names-en
*
* @example
* var names = require( '@stdlib/datasets/female-first-names-en' );
*
* var data = names();
* // returns [ 'Aaren', 'Aarika', 'Abagael', 'Abagail', 'Abbe', ... ]
*/

// MODULES //

var IS_BROWSER = require( '@stdlib/assert/is-browser' );


// MAIN //

var names;
if ( IS_BROWSER ) {
	names = require( './browser.js' );
} else {
	names = require( './female_first_names_en.js' );
}


// EXPORTS //

module.exports = names;
